/**
 * Trace object which represent a data from APISense
 */
var Trace = (function() {

	function Trace(timestamp, longitude, latitude, accuracy, speed) {
		this.timestamp = timestamp;
		this.longitude = longitude;
		this.latitude = latitude;
		this.accuracy = accuracy;
		this.speed = speed;
	}

	Trace.prototype.toString = function() {
		return this.timestamp + " - " + this.latitude + " - " + this.longitude + " - " + this.accuracy + " - " + this.speed;
	};

	return Trace;

}());

module.exports = Trace;